import React from 'react'
import axios from "axios";



export const login_Api  = async(login_info)=>{
        try{
            const url = process.env.REACT_APP_API_BASE_URL+"/authetication" ;
            const res = await  axios.post(url,login_info);
            // console.log(typeof res.data)
            return res.data;
        }catch(err){
            console.log(err)
        }
    }
